import Logo from '../components/Logo/Logo'
import '../App.css'
import Restore from "../components/Restore/Restore";

function Res() {

  return (
    <div className="Login">
      <div className='header'>
      <Header/>
      </div>
      <div className='Logo'>
        <Logo/>
        </div>
        <div className='content'>
        <Restore/>

        </div>



    </div>
  );
}

export default Res;
